import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex justify-between items-center h-20 w-max-6xl w-[80%] mx-auto">
        <NavLink to="/">
          <div className="ml-5">
            <img src="" alt="logo" className="h-14" />
          </div>
          </NavLink>
          <div className="flex items-center font-medium text-slate-100 mr-5 space-x-6">
          <NavLink to="/">
            <p>Home</p>
            </NavLink>
            <NavLink to="/cart">
            <div>
                <FaShoppingCart/>
            </div>
            </NavLink>
          </div>
      </div>
    </div>
  );
};

export default Navbar;
